    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    function slideshowResize () {
      window.dispatchEvent(new Event('resize'))
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        slideshow.resume()
        slideshowResize()
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        slideshow.pause()
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

    <script>/* global slideshow,window,document */
window.xaringanExtraClipboard = function (selector, text) {
  if (!window.ClipboardJS.isSupported()) return
  if (!window.xaringanExtraClipboards) window.xaringanExtraClipboards = {}

  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const {
      button: buttonText = 'Copy Code',
      success: successText = 'Copied!',
      error: errorText = 'Press Ctrl+C to Copy'
    } = text

    const template = '<button class="xaringanextra-clipboard-button" ' +
       `type="button" aria-label="Copy code to clipboard">${buttonText}</button>`

    const isRemarkSlideshow = typeof slideshow !== 'undefined' &&
      Object.prototype.hasOwnProperty.call(slideshow, 'getSlides')

    let siblingSelector = selector || 'pre'
    if (!selector && isRemarkSlideshow) {
      siblingSelector = '.remark-slides-area ' + siblingSelector
    }

    // insert <button>s
    document.querySelectorAll(siblingSelector).forEach(el => {
      if ([/^$/, 'inherit', 'unset', 'revert', 'static'].some(p => el.style.position.match(p))) {
        el.style.position = 'relative'
      }
      el.insertAdjacentHTML('beforeend', template)

      // match button text color to code color
      const currentColor = window.getComputedStyle(el.children[0]).getPropertyValue('color')
      el.querySelector('button.xaringanextra-clipboard-button').style.color = currentColor
    })

    // initialize cliboardjs
    const clipboard = new window.ClipboardJS(siblingSelector + ' .xaringanextra-clipboard-button', {
      text: function (trigger) {
        // temporarily remove the button text
        // so that it isn't included in the text that's copied
        const btnLabel = trigger.innerHTML
        trigger.innerHTML = ''
        // snapshot text of copy button's parent element
        const text = trigger.parentElement.innerText
        // restore the button's inner HTML
        trigger.innerHTML = btnLabel
        return text
      }
    })

    // show success text for 2.5 seconds on success
    clipboard.on('success', function (ev) {
      ev.trigger.innerHTML = successText
      ev.trigger.style.display = 'block'
      setTimeout(function () {
        ev.trigger.innerHTML = buttonText
        ev.trigger.style.display = ''
      }, 2500)
      ev.clearSelection()
    })

    // show error text for 2.5 seconds on error
    clipboard.on('error', function (ev) {
      ev.trigger.innerHTML = errorText
      setTimeout(function () { ev.trigger.innerHTML = buttonText }, 2500)
    })

    // block remark click/touch slide change event listeners
    if (isRemarkSlideshow) {
      ['touchstart', 'touchend', 'touchmove'].forEach(function (evType) {
        document.querySelector('.remark-slides-area').addEventListener(evType, function (ev) {
          if (!ev.target.closest('pre')) return
          if (ev.target.closest('pre').querySelector('.xaringanextra-clipboard-button')) {
            ev.stopPropagation()
          }
        })
      })
    }

    window.xaringanExtraClipboards[siblingSelector] = clipboard
  })
}

.title[
# Tools and Workflows for Reproducible Research in the Quantitative Social Sciences
]
.subtitle[
## Sharing &amp; publishing
]
.author[
### Johannes Breuer, Bernd Weiss, &amp; Arnim Bleier
]
.date[
### 2022-11-18
]

---

layout: true





---

## Sharing is caring

One prerequisite for research being reproducible (by others) is sharing research materials. There are many parts of their work that researchers can share to increase the reproducibility as well as the (potential) replicability of their work (see [Klein et al. , 2018](https://doi.org/10.1525/collabra.158)). Four main types of output are:

1. Data
2. Code &amp; scripts (for data collection, processing, and analysis)
3. Other study materials (e.g., questionnaires or stimulus materials)
4. (Detailed) Information about the study procedure

Notably, all of these outputs should be well-documented (e.g., via README files, metadata or comments in code).

---

## Sharing for reproducibility

While sharing study materials and information about the procedure are important for replicability, for reproducibility, the most important things to share are the data and code.

---

## Sharing options

In the previous sessions, we have seen how we can use *Jupyter Notebooks* and *Binder* to share our code and results in a way that also enables interactivity. The underlying files were hosted on *GitHub*. However, while *GitHub* is very useful for developing and sharing code, it is not an ideal platform for sharing data. There are different reasons for that:

  - data files are not necessarily plain-text formats
  - privacy/data protection issues with public repositories
  - questions regarding how to document materials

---

## Sharing options

There are many different ways in which researchers can share their data and code/scripts (see [Klein et al., 2018](https://doi.org/10.1525/collabra.158)). Keeping only local copies of things and sharing upon personal request is not a very sustainable or scalable solution. A better option is sharing via institutional or public archives and repositories.

---

## Fantastic repositories and where to find them ð

The paper by [Klein et al. (2018)](https://doi.org/10.1525/collabra.158) provides an overview of public repositories that hold psychological data.&lt;sup&gt;1&lt;/sup&gt;
A good tool for finding suitable repositories is the [*Registry of Research Data Repositories*](https://www.re3data.org/).

&lt;small&gt;&lt;small&gt;[1] However, parts of this overview have inevitably become somewhat outdated since the paper was published.&lt;/small&gt;&lt;/small&gt;

---

## How to choose a repository

In general, research data (and code) that are publicly archived should follow the so-called [FAIR principles](https://www.go-fair.org/fair-principles/) ([Wilkinson et al., 2016](https://doi.org/10.1038/sdata.2016.18)), meaning that the shared materials should be...

- **F**indable: Persistent identifiers; metadata; indexed
- **A**ccessible: Retrievable by identifier; controlled access where necessary
- **I**nteroperable: Standardized metadata; open, lightweight, and interoperable file formats (e.g., CSV, TSV, JSON, ODS)
- **R**eusable: Documented; clear usage license

---

## How to choose a repository

Some more specific key criteria for choosing a repository are that it should...

- use persistent and unique identifiers (such as DOIs)
- accommodate licensing
- feature access controls (e.g., allowing the restriction of 
access to a particular set of users)
- have persistence guarantees for long-term access
- store data in accordance with local legislation (e.g. the [GDPR](https://gdpr.eu/) in Europe)

.small[See [Klein et al. (2018)](https://doi.org/10.1525/collabra.158) for further details
]

---

## General public archiving options

Two archiving options that are quite popular among researchers are the [*Open Science Framework*](https://osf.io/) (OSF) and [*Zenodo*](https://zenodo.org/). 

--

While these two archives are not curated, which somewhat reduces findability, they are quite flexible and easy to use. They can be used to share different types of content, including data and code, and also offer some degree of access control. A nice feature of the *OSF* and *Zenodo*, especially for sharing code, is that they offer integration with *GitHub*.

---

## Curated disciplinary archives

A good way to maximize findability and reusability is to make use of curated disciplinary archives. Two of their key advantages are that they a) offer support for researchers who want to archive and share their data, and b) employ structured metadata.

---

## Curated disciplinary archives

*GESIS* offers a [data archive](https://www.gesis.org/en/data-services/share-data) for quantitative social science data with a focus on survey data (and now also digital trace data).

There also are data archives with a social science focus in other countries. Many of the European ones are members of [*CESSDA*](https://www.cessda.eu/), and in the U.S. there is the [*ICPSR*](https://www.icpsr.umich.edu/web/pages/).

---

## Curated disciplinary archives

There are, of course, other curated repositories with a focus on specific disciplines and/or data types, such as [*PsychArchives*](https://www.psycharchives.org/) by *ZPID* for psychology, or [*Qualiservice*](https://www.qualiservice.org/en/) in Germany and the [*The Qualitative Data Repository*](https://qdr.syr.edu/) in the U.S. for qualitative data.

---

## It&#39;s all about collaboration ð¤

&lt;img src=&quot;data:image/png;base64,#Sharing_publishing_files/figure-html/collab-tweet-1.png&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
https://twitter.com/jakevdp/status/519563939177197571

---

## Teaming up for reproducible research

Up until now, the scenario in this workshop was that we work alone on our code and data (as well as the reports we produced based on those). However, we typically have collaborators/coauthors with whom we do this. In such cases, we need to have solutions in place for collaboratively editing the materials and resulting output.

Lucky for us, *Git* &amp; *GitHub* have options for collaborating with others (which we will discuss in the next session).
